import React from 'react';

const Logo: React.FC = () => {
  return (
    <div className="flex items-center space-x-4">
      {/* Minimal EE Logo */}
      <div className="p-3 bg-black rounded-none border-2 border-black shadow-brutal">
        <div className="w-8 h-8 flex items-center justify-center">
          <div className="w-6 h-6 border-2 border-white relative">
            {/* Circuit-like elements */}
            <div className="absolute top-0 left-1/2 transform -translate-x-1/2 w-1 h-1 bg-white"></div>
            <div className="absolute bottom-0 left-1/2 transform -translate-x-1/2 w-1 h-1 bg-white"></div>
            <div className="absolute left-0 top-1/2 transform -translate-y-1/2 w-1 h-1 bg-white"></div>
            <div className="absolute right-0 top-1/2 transform -translate-y-1/2 w-1 h-1 bg-white"></div>
            {/* Center dot */}
            <div className="absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 w-1 h-1 bg-white"></div>
          </div>
        </div>
      </div>
      <div>
        <h1 className="text-2xl font-black text-black">Electrical Engineering</h1>
        <p className="text-sm font-bold text-black">University of Ottawa - Course Timeline</p>
      </div>
    </div>
  );
};

export default Logo;
